import { BMI, ASCAP, SESAC, GMR, HFA } from "./images";

const PROs = () => {
  return (
    <div>
      <img src="./images/BMI.png" alt="" />
      <img src="./images/ASCAP.png" alt="" />
      <img src="./images/SESAC.png" alt="" />
      <img src="./images/GMR.png" alt="" />
      <img src="./images/HFA.png" alt="" />
    </div>
  );
};

export default PROs;
